INSERT INTO cbt_soal VALUES("1107","SMA16","ANTRO","BHS","46","","Dalam kehidupan masyarkat Bali mengenal sistem kekerabatan klan yang disebut  Tunggal dadia Hal ini merupakan nilai budaya dalam bidang","","","","Religi","Sosial","Agama","Ekonomi","Seni","","","","","","2","1");
INSERT INTO cbt_soal VALUES("1106","SMA16","ANTRO","BHS","45","","1.Menerima keadaan dengan apa adanya\n2.Alam merupakan  sebuah dunia yang harus dieksploitasi\n3.Menyesuaikan diri dengan alam dan lingkungan \n4.Berpikir berdasarkan ajaran agama\nDari uraian diatas nilai nilai yang termasuk dalam budaya timur adalah\n","","","","1 dan 2","1 dan 3","3 dan 4","2 dan 4","1 dan 4","","","","","","3","1");
INSERT INTO cbt_soal VALUES("1105","SMA16","ANTRO","BHS","44","","Dalam kehidupan sosial masyarakat Papua khususnya suku Asmat memiliki rumah adat yang memiliki posisi istimewa dalam struktur suku Asmat.            Rumah adat ini dikenal dengan nama","","","","Baileo","Rumah gadang","Honai ","Jew","Bilek","","","","","","4","1");
INSERT INTO cbt_soal VALUES("1104","SMA16","ANTRO","BHS","43","","1.Satu keluarga tinggal dalam satu rumah yang disebut Bilek\n2.Mayoritas masyarakatnya beragama Islam\n3.Kerajinan  yang terkenal adalah sulaman kerawang\n4.Nilai nilai terdapat dalam ungkapan Delo Tutumolo lambi\n5.Mayoritas masyarakat beragama Hindu\nDari pernyataan diatas manakah yang  termasuk dalam nilai budaya masyarakat Gorontalo\n","","","","1 2 dan 3","2 3 dan 4","1 3 dan 5","2 4 dan 5","3 4 dan 5","","","","","","2","1");
INSERT INTO cbt_soal VALUES("1103","SMA16","ANTRO","BHS","42","","Siri Na Pacce  Tudang sipulung Sipatangarri Parentai Tawwa Ri Erona merupakan contoh Nilai budaya timur yang berasal dari daerah","","","","Banten","Makassar","Aceh","Madura","Yogyakarta","","","","","","2","1");
INSERT INTO cbt_soal VALUES("1102","SMA16","ANTRO","BHS","41","","1.Tingginya kedudukan orang yang membawa nilai itu\n2.Merupakan kepribadian bawah sadar\n3.Lamanya nilai dirasakan oleh anggota kelompok yang menganut nilai itu\n4.Tidak berdiri sendiri\nDari pernyataan diatas yang merupakanciri ciri nilai dominan adalah\n","","","","1 dan 4","2 dan 3","1 dan 3","1 dan 2","2 dan 4","","","","","","3","1");
INSERT INTO cbt_soal VALUES("1101","SMA16","ANTRO","BHS","40","","Pada saat terjadi musibah  kebakaran seorang ibu dengan berani menolong anak anaknya yang terperangkap api di dalam rumah meskipun harus mempertaruhkan nyawanya sendiri Sikap ibu ini merupakan contoh nilai","","","","Mendarah daging  ","Dominan","Berdiri sendiri","Tidak berdiri sendiri","Agama","","","","","","1","1");
INSERT INTO cbt_soal VALUES("1100","SMA16","ANTRO","BHS","39","","Dibawah ini manakah yang bukan merupakan pengelompokkan nilai budaya menurut Koentjaraningrat","","","","Nilai budaya dalam hubungannnya dengan lingkungan","Nilai budaya dalam hubungannnya dengan Tuhan","Nilai budaya dalam hubungannnya dengan  Masyarakat","Nilai budaya dalam hubungannnya dengan alam","Nilai budaya dalam hubungannnya dengan diri sendiri","","","","","","1","1");
INSERT INTO cbt_soal VALUES("1099","SMA16","ANTRO","BHS","38","","Risma selalu menjaga lingkungan disekitar dengan baik, melawat pohon dan tanaman agar tumbuh subur sikap Risma merupakan contoh nilai budaya","","","","Dalam hubungan dengan Tuhan","Dalam hubungan dengan masyarakat","Dalam hubungan dengan alam","Dalam hubungan dengan diri sendiri","Dalam hubungan dengan orang lain","","","","","","3","1");
INSERT INTO cbt_soal VALUES("1098","SMA16","ANTRO","BHS","37","","1.Sebagai suatu himpunan gagasan\n2.Sebagai  suatu kebiasaan\n3.Sebagai perilaku yang berpola\n4.Sebagai sekumpulan warisan\n5.Sebagai kumpulan benda atau artefak \nDari pernyataan diatas yang merupakan wujud kebudayaan yaitu\n","","","","1 2 dan  3","1 3 dan  4","1 3 dan  5","2 3 dan  4","3 4 dan  5","","","","","","3","1");
INSERT INTO cbt_soal VALUES("1097","SMA16","ANTRO","BHS","36","","Sesuatu yang menyangkut keyakinan umum dari sebuah konsepsi atau implisit yang khas milik seorang individu atau kelompok menyangkut  sesuatu yang baik dan buruk  disebut dengan istilah","","","","Budaya","Nilai","Kebudayaan","Nilai Budaya","Nilai Kebudayaan","","","","","","2","1");
INSERT INTO cbt_soal VALUES("1096","SMA16","ANTRO","BHS","35","","Dewi lebih memilih menggunakan baju batik pada acara ulang tahunnya dari pada menggunakan kaos sikap Dewi ini merupakan upaya menanggulangi dampak globalisasi berupa","","","","Belajar dengan giat","Mempertebal keimanan","Bersikap selektif","Bersikap rendah hati","Bersikap moderat","","","","","","3","1");
INSERT INTO cbt_soal VALUES("1095","SMA16","ANTRO","BHS","34","","Kamu pergi ke suatu daerah Kebudayaan daerah tersebut berbeda dengan daerah asalmu. Sikapmu sebaiknya ( upaya Penanggulangan dampak)","","","","Menghargai dan menghormati kebudayaan tersebut","Mencampur adukkan dengan kebudayaan sendiri","Acuh tak acuh","Menjauh agar tidak mempengaruhi budaya sendiri","Berpura pura menerima kebudayaan daerah itu","","","","","","1","1");
INSERT INTO cbt_soal VALUES("1094","SMA16","ANTRO","BHS","33","","1. Pergaulan bebas\n2. Individualis\n3. Kenakalan remaja\n4. Kurangnya ilmu pengetahuan\n5. Konsumerisme dikalangan orang kaya baru\nDari pernyataan diatas manakah yang merupakan contoh Anomie\n","","","","1,3 dan 5","1,3,dan 4","3,4 dan 5","1,2 dan 5","2,3 dan 4","","","","","","1","1");
